      SELECT DISTINCT - col0 * 97 AS col1 FROM tab1 (FORMAT parquet) AS cor0 WHERE col1 + + col2 * + + 68 * - 77 IN ( - col2 * col2 + ( col1 ) );
  - name: tab1

outputs:
  - name: q2785.out
    data: |
